INSERT INTO `lud_company_info` VALUES (2, 1001, '新疆丝路鸿途软件科技有限公司', '新疆丝路鸿途', 'Xinjiang Silk Road Software Technology Co., Ltd.', '01', '6501', '邓君', ' +(86) 0991-5269955 ', '新疆乌鲁木齐经济技术开发区喀纳斯湖北路455号新疆软件园创智大厦5楼5001室、5002室', ' +(86) 0991-5269955 ', 'admin@auticn.com', '水利信息化系统设计、集成、施工及维护；安全防范系统设计及施工；计算机软件产品开发、销售；计算机系统服务、工业自动化控制系统设计、集成及施工；计算机及应用和信息网络工程设计及施工；自动化、电子、通讯、机械、仪器、仪表设备的销售及技术开发、转让、咨询、服务。', '0', 0, '2018-12-03 11:12:54');
INSERT INTO `lud_company_info` VALUES (3, 1002, '西南交通大学', '西南交大', 'Southwest Jiao Tong University ', '02', '5101', '李敏', '+(86) 028-87634598', '中国四川省成都市二环路北一段111号5#网络教育', ' +(86) 028-87600332', 'admin@xnjd.cn', '西南交通大学远程与继续教育学院是学校直属二级单位，代表学校承办并归口管理各类学历继续教育、非学历继续教育和社会化考试等工作，是学校优质教育资源服务于社会的重要窗口。 \r\n\r\n继续教育一直是西南交通大学办学体系中的重要组成部分。学校在学历继续教育方面具有悠久的历史，从1956年即开办成人高等教育。经数十年发展，先后举办过夜大学、函授、脱产、半脱产、自考助学等形式的成人高等学历教育。2001年学校获教育部批准，成为可以开展现代远程教育的试点高校。在非学历继续教育方面，学校曾先后获批成为国家经贸委工商管理培训基地、铁道部继续教育西南基地、四川省专业技术人员继续教育基地，是全国高校继续教育学会常务理事单位。学校还积极承担各类行业和社会考试工作，是全国计算机等级考试四川中心考点，全国公共英语等级考试四川指导中心和中国市场营销资格考试的授权考点，是教育部“全国高校网络教育考试委员会成都考区办公室”。 \r\n\r\n作为学校继续教育的承办单位，原成人（继续）教育学院和网络教育学院在过去的教学实践中进行了可贵的探索，取得了令人瞩目的成绩，得到了社会和上级主管部门的好评。曾分别获得“高等教育自学考试先进集体”、“全国计算机等级考试优秀考点”、 “国家精品课程（网络教育）建设组织奖”金奖、“中国十佳网络教育学院”和“最受社会认可远程教育学院”等荣誉称号。 \r\n\r\n新组建的西南交通大学远程与继续教育学院面向高中起点专科、高中起点本科和专科起点本科三种层次，开办有网络教育、成人高等教育、高等教育自学考试等多种形式的学历继续教育，涵盖了教育部许可开办的所有高等学历继续教育的层次和种类。目前，学院可开设40余个网络教育专业、50余个成人函授和自学考试专业，在全国25个省（直辖市、自治区）设立了60余个网络教育学习中心、10多个成人高等教育校外函授站和10余个自考助学点。学历教育的办学规模和在校学生人数，均居同行业前列。远程与继续教育学院还将依托学校学科覆盖面广、教学力量强的优势，继续面向企业、行业和社会举办各种层面、各种类型的培训班。尤其利用学校在轨道交通领域的专业优势，积极组织机务、工务、牵引供电、运输调度、无缝焊接、运营管理等相关培训，为铁路和城市轨道交通培养专业人才。 \r\n\r\n在新的形势下，远程与继续教育学院将始终坚持严谨治学、规范管理、提高质量、办出特色的指导方针，以服务社会发展为宗旨，确立培养优秀的技能型、应用型人才的办学目标，重视技术创新和教学支持服务，积极探索培养创新型、实用型、技能型人才的新模式。大力推进学院的科学发展、创新发展与特色发展，努力打造一流的远程与继续教育品牌，让西南交通大学优质的教育资源更多的回馈于社会、服务于经济建设，为国家建设终身学习体系和学习型社会做出更大的贡献！ \r\n', '0', 0, '2018-12-03 11:12:57');
INSERT INTO `lud_company_info` VALUES (4, 1003, '四川天亦通科技有限公司', '四川天亦通', 'Sichuan tianyitong Technology Co., Ltd. ', '01', '5101', '陈刚', '+(86) 028-67873806', '成都市金牛区九里堤星辰东一街10号', '+(86) 028-67873806', 'tyt@auticn.com', '铁路专用设备及器材、城市轨道交通设备、智能车载设备、仪器仪表、计算机、工业机器人、电子产品、机械设备的研究、设计、销售、租赁与上门维修;软件开发;数据处理和存储服务;集成电路设计;信息系统集成;物联网信息服务;信息技术咨询服务(不含信息技术培训服务);人力中介服务;会议及展览服务;网上贸易代理;货物及技术进出口。 (依法须经批准的项目,经相关部门批准后方可开展经营活动)。 ', '0', 0, '2018-12-03 11:13:00');
INSERT INTO `lud_company_info` VALUES (5, 1004, '基点维科医疗机器人技术有限公司', '基点维科', 'Basic point Victor Medical Robot Technology Co., Ltd. ', '01', '5101', '胡经理', '+(86) 028-67873806', '成都市郫都区德源镇(菁蓉镇)胜利北街129号', '+(86) 028-67873806', 'admin@auticn.com', '医疗机器人设备的开发、生产、销售、调试、维修、技术服务及技术转让;医疗器械的技术开发、生产、技术转让及技术咨询;计算机软、硬件及其配件的研发、生产和销售;医疗器械、医疗设备、仪器及实验室辅材的生产、销售(仅限分支机构或另择经营场所从事生产、加工);货物及技术的进出口业务(以上范围不含国家法律、行政法规、国务院决定限制或禁止的项目,依法须经批准的项目,经相关部门批准后方可开展经营活动)。 ', '0', 0, '2018-12-05 11:13:04');
INSERT INTO `lud_company_info` VALUES (6, 1005, '广州洪森科技有限公司', '广州洪森', 'Guangzhou Hong Sen Technology Co., Ltd. ', '01', '4401', '王竹林', '+(86) 020-85645986', '广州市番禺区亚运大道895号合劲嘉福创新城B栋 ', ' +(86) 020-85645986', 'Hstt@hsv-tec.com ', '广州洪森科技有限公司成立于 2013 年,以“技术创新、产品创新、平台服务”为理念，以“创新、发展图像数据管理技术，以 海量数据智能分析和应用服务来持续改善用户的行业应用体验”为使命。 \r\n\r\n公司作为国家级高新技术企业，专注于在人工智能领域以计算机深度学习为基础的视觉与模式识别、图像结构化、图像大数据等 领域核心技术的突破和发展。并以核心技术为基础面向不同的行业提供多数据融合、数据智能分析挖掘、数据应用为优势特点的 数据综合管理云平台，解决行业用户在图像超分处理、图像智能分析、人像识别、车牌识别、数据结构化存储、智能检索、数据 分析、预案执行及演练、应急指挥等技术支持下的行业深层次的数据管理应用的行业需求。 \r\n\r\n公司拥有多项自主知识产权及高新技术产品，在人工智能图像处理领域处于行业的前沿。在国内二十多个省市、东南亚、澳大利 亚、美国等地设立技术支持团队和服务中心，为用户提供快速优质的服务。 \r\n\r\n广州洪森科技有限公司致力成为中国“图像数据管理及应用科技先锋” \r\n', '0', 0, '2018-12-06 11:13:07');
INSERT INTO `lud_company_info` VALUES (7, 1006, '四川日机密封件股份有限公司', '四川日机', 'Sichuan daily seal Limited by Share Ltd ', '01', '5101', '肖丁', '+(86) 028-85360123', '成都市武侯区武科西四路八号', ' +(86) 028-85367231', 'export@sns-china.com', '四川日机密封件股份有限公司是国内机械密封行业唯一的上市公司，是中国流体密封行业的领航者。从专注的研究，到专业的生产运营，从单一的产品，到整体的解决方案，日机密封历经四十年的传承与积淀，凭借雄厚的技术实力，先进精湛的装备，“日机密封”品牌已享誉整个中国，并逐步走向国外，致力成为一流的国际品牌。 \r\n\r\n公司将始终秉承“供需双赢、协调发展”的核心价值观，以客户需求为己任，以保障安全、保护环境为使命，再接再厉，迎难而上，实现发展历程中的一次次跨越。 ', '0', 0, '2018-12-06 11:13:19');
INSERT INTO `lud_company_info` VALUES (8, 1007, '湖北省宜昌市夷陵区童贩村', '湖北夷陵童贩村', 'Tong Trafficking Village, Yiling District, Yichang City, Hubei Province ', '03', '4205', '童畈村', '+(86) 028-67873806', '湖北省宜昌市夷陵区鸦鹊岭镇童畈村', '+(86) 028-67873806', 'admin@auticn.com', '童畈村又名童家畈村，位于湖北省宜昌市夷陵区鸦鹊岭镇东部，北与三合村接壤，南与东山村隔三岔河相望，东抵泉河与当阳王店镇史店村相望，西靠白家河与梅林村相望。三面环水，北高南低的自然村落，地势平坦，土地肥沃，土壤酸碱度适中。交通方便，汉宜公路横穿东西，襄石铁路纵穿境内，村、组、户晴雨路相通2.48万米。白河灌渠和提水站三面光渠道2。7万米，路渠配套。全村641户、2067人，全村版土面积6.99平方公里。以猪、柑、渔、粮、油、菜六大支柱产业为龙头经济发展社会进步。 [1]  ', '0', 0, '2018-12-25 06:32:41');
