INSERT INTO `lud_project_info` VALUES (1, 100101, '智慧水库远程集控系统', '2018-05-31', 'sysmanager', '2018-05-31', 'sysmanager', '水利信息化系统设计、集成、施工及维护；安全防范系统设计及施工；计算机软件产品开发、销售；计算机系统服务、工业自动化控制系统设计、集成及施工；计算机及应用和信息网络工程设计及施工；自动化、电子、通讯、机械、仪器、仪表设备的销售及技术开发、转让、咨询、服务。', '1001', 'Reservoir Automatic Monitoring Of Remote Intelligent Control System', '0.1.0.0', '/web-resource/add-on/lud/images/pictures/small/22.jpg');
INSERT INTO `lud_project_info` VALUES (2, 100201, '教育信息管理系统', '2018-06-02', 'sysmanager', '2018-06-02', 'sysmanager', '西南交通大学（Southwest Jiaotong University）简称西南交大，位于四川成都，是中华人民共和国教育部直属，并由教育部、中国铁路总公司、四川省和成都市共建的全国重点大学，是进入国家首批“世界一流学科建设高校”，先后入选“211工程”“985工程优势学科创新平台”“111计划”“2011计划” “卓越计划”等建设工程，是中法4+4、中欧精英大学联盟主要成员以及国家建设高水平大学公派研究生项目、援藏计划培养院校。\r\n\r\n学校创建于1896年，前身为山海关北洋铁路官学堂，是中国第一所工程高等学府，中国土木工程、交通工程、矿冶工程高等教育的发祥地，交通大学最早两大源头之一，以“唐山交大”和“唐院”之名享誉中外，毛泽东同志为学校题写了校名。学校曾先后定名唐山交通大学、交通大学唐山工程学院、中国交通大学、北方交通大学和唐山铁道学院等，1964年内迁四川，1972年更名西南交通大学。', '1002', 'Distance and Continuing Education College of SWJTU', '0.1.0.0', '/web-resource/add-on/lud/images/pictures/small/24.jpg');
INSERT INTO `lud_project_info` VALUES (3, 100202, '平安校园信息管理系统', '2018-06-05', 'sysmanager', '2018-06-05', 'sysmanager', '西南交通大学（Southwest Jiaotong University）简称西南交大，位于四川成都，是中华人民共和国教育部直属，并由教育部、中国铁路总公司、四川省和成都市共建的全国重点大学，是进入国家首批“世界一流学科建设高校”，先后入选“211工程”“985工程优势学科创新平台”“111计划”“2011计划” “卓越计划”等建设工程，是中法4+4、中欧精英大学联盟主要成员以及国家建设高水平大学公派研究生项目、援藏计划培养院校。\r\n\r\n学校创建于1896年，前身为山海关北洋铁路官学堂，是中国第一所工程高等学府，中国土木工程、交通工程、矿冶工程高等教育的发祥地，交通大学最早两大源头之一，以“唐山交大”和“唐院”之名享誉中外，毛泽东同志为学校题写了校名。学校曾先后定名唐山交通大学、交通大学唐山工程学院、中国交通大学、北方交通大学和唐山铁道学院等，1964年内迁四川，1972年更名西南交通大学。', '1002', 'Security service vehicle information management system ', '0.1.0.0', '/web-resource/add-on/lud/images/pictures/small/23.jpg');
INSERT INTO `lud_project_info` VALUES (4, 100301, '轨道交通车载监测系统', '2018-07-24', 'sysmanager', '2018-07-31', 'sysmanager', '列车运行中的安全问题一直是轨道行业相关人员的最为关心的问题。在列车行驶中由于钢轨与车辆之间的冲击以及列车自身载重等原因，会使得轴承振动发热而造成磨损，严重的话会危害行车安全，所以对于轴承参数的测量是非常重要的。轴承的状况可以结合温度、振动、噪声等各种类型参数进行综合分析，从而得知轴承的情况，硬件部分结合 3 种不同类型传感器对轴承的温度、振动、噪声进行监测，同时进行数据通信将数据传输给车载端监控中心进行记录、分析和处理。', '1003', 'Vehicle monitoring system for rail transit ', '0.1.0.0', '/web-resource/add-on/lud/images/pictures/small/25.jpg');
INSERT INTO `lud_project_info` VALUES (5, 100302, '铁路线路涵洞限高防护架防撞预警系统', '2018-07-28', 'sysmanager', '2018-07-28', 'sysmanager', '铁路线路涵洞限高防护架防撞预警技术研究的研究内容主要有传感器的选型与使用；数据采集、分析、传输等系统的软硬件开发设计；终端或云端接收设备的软件开发设计；系统供电设备的开发设计。\r\n当防护架被撞击发生振动、位移甚至折断时，根据安装在限高架上的传感器数据判断防护架遭受车辆刮擦或撞击产生的冲击力，根据冲击力预设值判断限高防护架处于何种破坏等级，系统立即发生报警并将破坏级别信息传输到云端或终端管理平台，工务段调度及其管理人员可快速获取信息并根据破坏等级采取应对措施，最大程度降低因撞击对铁路线路造成的破坏。', '1003', 'Anti-collision Early Warning System of Railway Line Culvert Limited Height Protective Frame ', '0.1.0.0', '/web-resource/add-on/lud/images/pictures/small/26.jpg');
INSERT INTO `lud_project_info` VALUES (6, 100401, '生物样本库信息化系统', '2018-07-28', 'sysmanager', '2018-07-28', 'sysmanager', '标准化收集、处理、储存和应用健康和疾病器官、组织、全血、血浆、血清、体液或经处理过的衍生物如DNA、ＲNA、蛋白等以及与这些生物样本相关的临床、病理、治疗、随访、知情同意、伦理批复等资料及其质量控制、信息管理与应用数据系统', '1004', 'Information system of biological sample library', '0.1.0.0', '/web-resource/add-on/lud/images/pictures/small/27.jpg');
INSERT INTO `lud_project_info` VALUES (7, 100501, '牵引变电所远程无人视控系统', '2018-07-28', 'sysmanager', '2018-07-28', 'sysmanager', '牵引变电所是指将发电厂经电力传输线送来的电能变换成适合机车车辆所需的电压，并分送到接触网或接触轨(第三轨)的场所。分直流牵引变电所和交流牵引变电所。前者将电力传输线送来的高压交流电能经变压器降压，然后经整流器变为直流后，送接触网或接触轨。后者可分为工频、低频单相及工频三相交流牵引变电所，它们分别把电力传输线送来的电能变换成上述三种交流电后，分送到相应的接触网。牵引变电所的主要设备有用于变换电压的变压器、用于接受和分配电能的配电装置以及用于控制和保护的开关等。 [1]  ', '1005', 'Information management system for rail transit ', '0.1.0.0', '/web-resource/add-on/lud/images/pictures/small/28.jpg');
INSERT INTO `lud_project_info` VALUES (8, 100601, '远程监测管理系统', '2018-07-28', 'sysmanager', '2018-07-28', 'sysmanager', '四川日机密封件股份有限公司是国内机械密封行业唯一的上市公司，是中国流体密封行业的领航者。从专注的研究，到专业的生产运营，从单一的产品，到整体的解决方案，日机密封历经四十年的传承与积淀，凭借雄厚的技术实力，先进精湛的装备，“日机密封”品牌已享誉整个中国，并逐步走向国外，致力成为一流的国际品牌。公司将始终秉承“供需双赢、协调发展”的核心价值观，以客户需求为己任，以保障安全、保护环境为使命，再接再厉，迎难而上，实现发展历程中的一次次跨越。', '1006', 'Remote monitoring and management system ', '0.1.0.0', '/web-resource/add-on/lud/images/pictures/small/29.jpg');
INSERT INTO `lud_project_info` VALUES (10, 100701, '农业水价综合改革信息系统', '2018-12-24', 'sysmanager', '2018-12-24', 'sysmanager', '2015年发布的中央一号文件对农业很多领域做出改革部署，推进农业水价综合改革就是其中一项。鉴于目前水资源在我国的稀缺程度，这项改革被政府明确要求“绝对不能拖”，接下来将尽快开展80个县的试点工作，并形成改革总体方案上报国务院。试点方面，地下水严重超采的地区要求“先行一步”，改革进度快的地区可以得到中央水利建设投资的倾斜 [1]  。\r\n\r\n权威人士曾在内部会议表态，政府对水价综合改革的态度是绝对不能拖。水价长期不能反映资源稀缺程度，既影响社会资本投资水利的积极性，也不利于节约用水。日前，刚刚履新的国家发改委农村经济司司长吴晓也公开表示，接下来将加强对27个省80个县农业水价综合改革试点的工作指导，认真总结经验，形成推进农业水价综合改革的意见，并尽快上报国务院。\r\n\r\n这项改革的目标是在保证农民基本用水需求的同时，建立多用水多花钱，少用水少花钱，不用水得补贴的机制。既不在总体上增加农民负担，又促进节约用水。具体措施在刚刚公布的中央一号文件第25条中有所提及：“推进农业水价综合改革，积极推广水价改革和水权交易的成功经验，建立农业灌溉用水总量控制和定额管理制度，加强农业用水计量，合理调整农业水价，建立精准补贴机制”。\r\n\r\n“总的来说，中国是一个水资源短缺的国家。”中央农村工作领导小组副组长、办公室主任陈锡文说，特别是长江以北，整个北方地区拥有的水资源只占全国水资源的1/5多一点，但是由于面积宽广，现在主要农产品的增产越来越依靠北方。所以怎么样既能科学地节约用水，又能促进生产的发展，带动农民的增收，政府是通盘考虑的。', '1007', 'Comprehensive Reform of Agricultural Water Price System', '0.1.0.0', '/web-resource/add-on/lud/images/pictures/small/30.jpg');
INSERT INTO `lud_project_info` VALUES (11, 100001, '智慧项目研发平台', '2018-12-24', 'sysmanager', '2018-12-24', 'sysmanager', 'This document is the outline design part of the remote monitoring system of the height limit protective shelf. It is compiled according to the specific requirements of the remote monitoring system of the height limit protective shelf and on the basis of full communication between various parties in the early stage. Through the compilation of this instruction, we can understand the background, basic concepts and basic business processes of the project, as well as the overall design, technical framework system and interface of the system. Design, data structure design and so on. \r\n\r\n\r\n\r\nThe Outline Design Instructions for the Remote Monitoring System of Limited Protective Frame is the main basis and standard for designers to design in detail. At the same time, the document further objectively and completely reflects the functional needs of users, and defines the development scope of the system. \r\n', '1000', 'Intelligent Project Management Platform ', '0.1.0.0', '/web-resource/add-on/lud/images/pictures/small/21.jpg');
