INSERT INTO `lud_project_note` VALUES (20, 100202, '西南交通大学保卫处关于2019年度车辆管理费用交纳的通知', '为进一步加强校园交通管理，保障校园交通安全有序，维护学校正常的教学、科研和生活秩序以及为师生提供更大的便利，真正实现“让数据多跑路、让师生少跑路”。根据《西南交通大学校园交通管理办法》、《西南交通大学机动车出入分类收费管理细则》及学校门禁系统运行实际，以信息化技术为手段，建立“车辆自助缴费及因公预约平台”，实现教职工车辆在线办理延期、缴费等业务，同时校内各单位实现因公到校车辆在线预约功能。', '/web-resource/add-on/lud/images/pictures/small/24.jpg', '为进一步加强校园交通管理，保障校园交通安全有序，维护学校正常的教学、科研和生活秩序以及为师生提供更大的便利，真正实现“让数据多跑路、让师生少跑路”。根据《西南交通大学校园交通管理办法》、《西南交通大学机动车出入分类收费管理细则》及学校门禁系统运行实际，以信息化技术为手段...', '01', '2019-09-08 00:00:12', 1, '管理员', '保卫处', '1');
INSERT INTO `lud_project_note` VALUES (21, 100202, '西南交通大学保卫处关于教师补充车辆信息资料的通知', '为进一步加强校园交通管理，保障校园交通安全有序，维护学校正常的教学、科研和生活秩序以及为师生提供更大的便利，真正实现“让数据多跑路、让师生少跑路”。根据《西南交通大学校园交通管理办法》、《西南交通大学机动车出入分类收费管理细则》及学校门禁系统运行实际，以信息化技术为手段，建立“车辆自助缴费及因公预约平台”，实现教职工车辆在线办理延期、缴费等业务，同时校内各单位实现因公到校车辆在线预约功能。', '/web-resource/add-on/lud/images/pictures/small/23.jpg', '为进一步加强校园交通管理，保障校园交通安全有序，维护学校正常的教学、科研和生活秩序以及为师生提供更大的便利，真正实现“让数据多跑路、让师生少跑路”。根据《西南交通大学校园交通管理办法》、《西南交通大学机动车出入分类收费管理细则》及学校门禁系统运行实际，以信息化技术为手段，建立“车辆自助缴费及因公预约平台”，实现教职工车辆在线办理延期、缴费等业务，同时校内各单位实现因公到校车辆在线预约功能。', '01', '2019-10-28 14:04:35', 0, '管理员', '保卫处', '1');
INSERT INTO `lud_project_note` VALUES (22, 100202, '系统正在调试过程中，正式启用请等待通知', '系统调试中，暂时无法登录', '/web-resource/add-on/lud/images/pictures/small/21.jpg', '系统调试中，暂时无法登录', '01', '2019-10-28 14:04:39', 1, '管理员', '保卫处', '1');
INSERT INTO `lud_project_note` VALUES (23, 100202, '关于校内公共停车位文明使用倡议书', '<p>\r\n    &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 因我校教职工自有车辆不断增加，致使九里犀浦两校区车位紧张，且乱停乱放、长期停放不动，造成高峰时段道路交通拥堵现象。为进一步实施学校机动车道路停放管理规定，提高校内车位利用率，营造安全、有序的校园环境秩序；确保学校正常工作生活秩序；杜绝长期占用公共停车位资源，缓解‘停车难’问题。<br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 故倡议：<br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 一、九里校区南北园家属区外停车的车主，请尽量停进家属区内车位或电梯公寓地下停车场，禁止停在禁停区、转弯处及通道口等关键部位；<br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 二、犀浦校区综合楼、九教、八教等场所办公办事人员较多地点，请停在此处地下停车场长期不挪动的车主，主动将车辆移至学校其他僻静规范停车位；<br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 三、如办事所需临时停靠路旁，请保持车头顺向，禁止占用未划定停车泊位的人行道及盲道停放车辆。<br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 保卫处在此呼吁全校师生职工文明、有序、规范停车，为创造文明和谐有序的校园环境贡献自己的一份力量，同时也方便自己和他人出行！<br/>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <br/>\r\n</p>\r\n<p></p>', '/web-resource/add-on/lud/images/pictures/small/04.jpg', '       因我校教职工自有车辆不断增加，致使九里犀浦两校区车位紧张，且乱停乱放、长期停放不动，造成高峰时段道路交通拥堵现象。为进一步实施学校机动车道路停放管理规定，提高校内车位利用率，营造安全、有序的校园环境秩序；确保学校正常工作生活秩序；杜绝长期占用公共停车位资源，缓解‘停车难’问题。\r\n       故倡议：\r\n       一、九里校区南北园家属区外停车的车主，请尽量停进家属区内车位或电梯公寓地下停车场，禁止停在禁停区、转弯处及通道口等关键部位；\r\n       二、犀浦校区综合楼、九教、八教等场所办公办事人员较多地点，请停在此处地下停车场长期不挪动的车主，主动将车辆移至学校其他僻静规范停车位；\r\n       三、如办事所需临时停靠路旁，请保持车头顺向，禁止占用未划定停车泊位的人行道及盲道停放车辆。\r\n       保卫处在此呼吁全校师生职工文明、有序、规范停车，为创造文明和谐有序的校园环境贡献自己的一份力量，同时也方便自己和他人出行！\r\n                                \r\n\r\n', '01', '2019-10-02 00:36:15', 0, '管理员', '保卫处', '1');
INSERT INTO `lud_project_note` VALUES (24, 100202, '西南交通大学校园交通管理办法', '<p>\r\n    &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br/>\r\n</p>\r\n<p style=\"text-align: center;\">\r\n    <span style=\"font-family: 宋体; font-size: small;\"><strong><span style=\"font-family: 宋体; font-size: 19px;\">第一章&nbsp; 总则</span></strong></span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <strong><span style=\"font-family: 宋体; font-size: 19px;\">第一条</span></strong><span style=\"font-family: 宋体; font-size: 19px;\"> 为进一步加强校园交通管理，保障校园交通安全有序，维护学校正常的教学、科研和生活秩序以及师生员工的人身财产安全，根据《中华人民共和国道路交通安全法》《中华人民共和国道路交通安全法实施条例》及有关法律法规，结合学校实际，制定本办法。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <strong><span style=\"font-family: 宋体; font-size: 19px;\">第二条</span></strong><span style=\"font-family: 宋体; font-size: 19px;\"> 凡在西南交通大学校园道路上的车辆驾驶人、行人、乘车人以及与道路交通活动有关的单位和个人，都应当遵守本办法。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <strong><span style=\"font-family: 宋体; font-size: 19px;\">第三条</span></strong><span style=\"font-family: 宋体; font-size: 19px;\"> 校园交通管理，遵循以人为本、依法管理的原则，做到有规可依、有规必依、执规必严、违规必究，保障道路交通有序、安全、畅通。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <strong><span style=\"font-family: 宋体; font-size: 19px;\">第四条</span></strong><span style=\"font-family: 宋体; font-size: 19px;\"> 单位和个人依法参与校园道路交通活动受法律保护，对违反道路交通安全法律、法规的行为有劝阻、举报<span style=\"font-size: 14px;\"></span>的权利。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-indent: 197px;\">\r\n    <strong><span style=\"font-family: 宋体; font-size: 19px;\">&nbsp;</span></strong> \r\n</p>\r\n<p style=\"text-align: center;\">\r\n    &nbsp;<strong><span style=\"font-family: 宋体; font-size: 19px;\">第二章　部门职责</span></strong> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <strong><span style=\"font-family: 宋体; font-size: 19px;\">第五条 </span></strong><span style=\"font-family: 宋体; font-size: 19px;\">保卫处、党政办公室、宣传部、学生处、人事处、校工会、信息网络与管理处、离退处、后勤与基建管理处、产业集团公司等相关人员组成校园交通管理委员会，由分管校领导任主任、保卫处处长任副主任，对涉及校园道路及交通相关议题进行决策。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <strong><span style=\"font-family: 宋体; font-size: 19px;\">第六条 </span></strong><span style=\"font-family: 宋体; font-size: 19px;\">校园交通管理委员会负责校园道路交通设施和停车场（位）规划，审定学校交通安全管理规章制度，研究其他涉及学校交通管理的事项。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <strong><span style=\"font-family: 宋体; font-size: 19px;\">第七条 </span></strong><span style=\"font-family: 宋体; font-size: 19px;\">保卫处负责在校园道路交通规划建设的基础上，对进出校园车辆进行管理，维护校内交通秩序，协助公安交通管理部门处理交通事故及案件。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <strong><span style=\"font-family: 宋体; font-size: 19px;\">第八条 </span></strong><span style=\"font-family: 宋体; font-size: 19px;\">校内各单位应当经常对本单位的师生员工进行道路交通安全、法制教育，提高师生员工的道路交通安全、法律意识。</span> \r\n</p>\r\n<p>\r\n    <span style=\"font-family: 宋体; font-size: 19px;\"><strong><span style=\"font-family: 宋体; font-size: 19px;\"><br/></span></strong></span>\r\n</p>\r\n<p style=\"text-align: center;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\"><strong><span style=\"font-family: 宋体; font-size: 19px;\">第三章&nbsp;&nbsp; 校门管理 </span></strong></span>\r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-indent: 37px;\">\r\n    <strong><span style=\"font-family: 宋体; font-size: 19px;\">第九条 </span></strong><span style=\"font-family: 宋体; font-size: 19px;\">&nbsp;将“认真管住、管好校门”作为校门管理的管理原则。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <strong><span style=\"font-family: 宋体; font-size: 19px;\">第十条</span></strong><span style=\"font-family: 宋体; font-size: 19px;\"> <strong>&nbsp;行人管理</strong></span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">成都两校区各大门处均安装行人双向通行道闸，行人凭证刷卡进出。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">（一）校内师生员工凭校园一卡通或身份证刷卡进出；</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">（二）教职工家属及外聘人员凭身份证、一卡通刷卡等相关证件进出；</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">（三）外来办事人员凭身份证刷卡进出；</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">（四）其他人员如未带有效证件，凭学生证、工作证、介绍信等有效证件在各门卫处登记进出校门。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">（五）一卡（证）一刷，禁止翻越、抢行、尾随、冲闸等行为。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <strong><span style=\"font-family: 宋体; font-size: 19px;\">第十一条 非机动车管理</span></strong> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 46px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">非机动车凭证刷卡双向进出校门：</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">（一）非机动车入校时须下车推行；</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">（二）车主刷一卡通或身份证进入校门；</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">（三）如未带有有效证件，凭学生证、工作证等在各门卫处登记进入校门；</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">（四）不能证明为本人车辆的，禁止进出校园。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">（五）一卡（证）一刷，禁止翻越、抢行、尾随、冲闸等行为。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">（六）除后勤工作保障三轮车外，禁止其它三轮车进入校园，入校三轮车一律悬挂相关单位保障用车标识并在标识上加盖单位公章。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <strong><span style=\"font-family: 宋体; font-size: 19px;\">第十二条 机动车管理</span></strong> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">（一）成都两校区校门均安装车辆门禁识别系统，校内车辆进入系统管理，进出校门时自动抬杆通行。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-indent: 28px;\">\r\n    <strong><span style=\"font-family: 宋体; font-size: 19px;\">（二）</span></strong><span style=\"font-family: 宋体; font-size: 19px;\">严格控制校外车辆进入校园。禁止校外人员驾车进入学校锻炼、穿行、停车过夜、送小孩参加校外组织的社会培训等；来校办理公务、施工、运送物资等的车辆，需由校内相关单位提前三个工作日通过西南交通大学车辆预约系统提交申请。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-indent: 28px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">（三）进校施工的车辆，由后勤与基建管理处提交申请（申请内容：车型、时间、出入门、进出货物品名、车牌号）；来校参加培训、考试或出席大型活动的车辆，可在规定时间内进入门禁系统；其它确需进入校园的校外车辆，由保卫处按照从严从紧原则进行规范管理。 </span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">（四）确因工作关系、业务培训、各类保障等车辆及上级主管部门车辆需长期进入校园的，由工作对接单位提出申请，报保卫处审核后由校园交通管理委员会确定。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-indent: 28px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">&nbsp;</span><span style=\"font-family: 宋体; font-size: 19px;\">（五）特种车辆如军车、警车、消防车、救护车、通讯车、水电天然气抢险车、邮政车、运钞车等除外；禁止社会车辆在学校借道穿行、停车过夜、非学校组织的培训或考试车辆驶入。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-indent: 37px;\">\r\n    <strong><span style=\"font-family: 宋体; font-size: 19px;\">第十三条 </span></strong><span style=\"font-family: 宋体; font-size: 19px;\">学校成都两校区各校门开放时间为：九里校区南门24小时开放，九里校区北门、西门每天6:30至23:00开放；</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">犀浦校区西门、东门每天6:30至23:00开放，风洞门每天6:30至24:00开放，南门24小时开放。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-indent: 32px;\">\r\n    <span style=\"font-family: 宋体; font-size: 21px;\">&nbsp;</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 168px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">&nbsp;<strong>&nbsp; </strong></span><strong><span style=\"font-family: 宋体; font-size: 19px;\">第四章&nbsp;&nbsp;&nbsp; 校园道路管理</span></strong> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <strong><span style=\"font-family: 宋体; font-size: 19px;\">第十四条 </span></strong><span style=\"font-family: 宋体; font-size: 19px;\">&nbsp;<strong>行人管理</strong></span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">（一）校园内行人应走人行道，没有划定人行道的道路应靠右侧路边通行；</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">（二）穿行道路或交叉路口时，应确认安全后再通行；</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">（三）通过有交通信号灯的路口，应当按照交通信号灯指示通行。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">（四）严禁在校园内有以下影响校园道路交通安全的行为：</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">1.</span><span style=\"font-family: 宋体; font-size: 19px;\">在道路上溜旱冰、滑轮板等；</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">2.</span><span style=\"font-family: 宋体; font-size: 19px;\">在道路上坐卧、嬉闹、打球、放风筝、强行拦车、追车等；</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">3.</span><span style=\"font-family: 宋体; font-size: 19px;\">影响校园道路交通安全和人身安全的其他行为。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <strong><span style=\"font-family: 宋体; font-size: 19px;\">第十五条&nbsp; 非机动车管理</span></strong> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">（一）非机动车行驶最高时速不得超过20公里／小时；未满12岁的儿童，不得在校园道路上骑自行车。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">（二）校园内应安全、文明骑行自行车、电瓶车、人力三轮保障车等，严禁逆向行驶、骑车时使用手机、骑快车、相互追逐、急转猛拐、双手脱把、攀扶其他车辆等有碍道路交通安全的行为。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">（三）校园电动摆渡车不得随意上下客，需在指定站台站点停靠，并严格按照相关路段红绿灯指示通行。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <strong><span style=\"font-family: 宋体; font-size: 19px;\">第十六条&nbsp; 机动车管理 </span></strong> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <strong><span style=\"font-family: 宋体; font-size: 19px;\">&nbsp;</span></strong><span style=\"font-family: 宋体; font-size: 19px;\">（一）所有进入校园的车辆必须服从指挥、服从管理，应当自觉遵守道路交通法律法规和校园交通管理的有关规定，文明驾驶、减速慢行。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">（二）校园内主环路限速（含）30KM/小时、支路限速(含)20km/小时，机动车在校园道路行驶不得超速、鸣笛、轰鸣、漂移。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">（三）机动车严禁驶入教学区和学生区。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">（四）校园道路严禁学车、练车、无证驾驶、酒后驾车以及通过十字交叉路口不遵守相关路段红绿灯指示减速慢行；在学生上下课高峰期时，机动车应主动避让，不得强行通过。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">严禁车辆在校园道路内超速、超载、超长、超高行驶，严禁夜间开远光灯，严禁不按道路标线行驶、逆行、或在非机动车道上驾驶机动车。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">（五）倡导师生员工绿色出行，尽量减少在校园交通中使用机动车。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">（六）犀浦校区全校区禁止社会人员机动摩托车及校内人员无牌机动摩托车、赛摩不得进入校园。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <strong><span style=\"font-family: 宋体; font-size: 19px;\">第十七条</span></strong><span style=\"font-family: 宋体; font-size: 19px;\"> 未经许可，任何单位和个人不得占用校园内道路从事非交通活动；任何单位和个人不得擅自设置、移动、占用、损毁交通信号灯、交通标志、交通标线。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <strong><span style=\"font-family: 宋体; font-size: 19px;\">第十八条 </span></strong><span style=\"font-family: 宋体; font-size: 19px;\">因工程建设需要占用、挖掘道路，或者跨越、穿越道路架设、增设管线设施，应当提前三天征得基建规划部门的同意，并报保卫处备案。施工作业单位应当在经批准的路段和时间内施工作业，并做好安全警示防护措施；施工作业完毕，应当迅速清除道路上的障碍物，消除安全隐患。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <strong><span style=\"font-family: 宋体; font-size: 19px;\">第十九条</span></strong><span style=\"font-family: 宋体; font-size: 19px;\"> 在校园道路范围内，在不影响行人、车辆通行的情况下，保卫处可以施划停车泊位。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <strong><span style=\"font-family: 宋体; font-size: 19px;\">第二十条 </span></strong><span style=\"font-family: 宋体; font-size: 19px;\">保卫处根据道路和学校实际，可以对机动车、非机动车、行人采取疏导、限制通行、禁止通行等措施。遇有大型群众性活动、大范围施工等情况，需要采取限制交通的措施，或者做出与公众的道路交通活动直接有关的决定，应当提前向学校师生员工公告。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: center; text-indent: 37px;\">\r\n    <strong><span style=\"font-family: 宋体; font-size: 19px;\">&nbsp;</span></strong> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: center; text-indent: 37px;\">\r\n    <strong><span style=\"font-family: 宋体; font-size: 19px;\">第五章&nbsp; 校园车辆停放</span></strong> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <strong><span style=\"font-family: 宋体; font-size: 19px;\">第二十一条 非机动车停放</span></strong> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">（一）停放非机动车时，应当下车推行，并在划定的停车线内或指定区域规范、有序停放。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">（二）全校所有办公楼、教学楼、实验楼、宿舍楼和其他用房等的走道内一律不得停放非机动车。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">（三）非机动车不得随意停放，不得堵塞消防通道或阻碍道路通行<strong>。</strong></span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">（四）校园内共享单车的投放应文明、科学，师生使用共享单车绿色出行应文明停放，在规定的停车线内有序停放。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <strong><span style=\"font-family: 宋体; font-size: 19px;\">第二十二条</span></strong><span style=\"font-family: 宋体; font-size: 19px;\">&nbsp; </span><strong><span style=\"font-family: 宋体; font-size: 19px;\">机动车停放</span></strong> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">（一）机动车辆进入校园后，应按照停车指示、标志，将车辆停放到指定停车场或停车位，车头需向外停靠；占道停放的车辆需沿行驶方向顺向停放。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">（二）遇有交通管理人员现场指挥时，应当按照交通管理人员的指挥停放；学校大型活动或执行特殊任务时，机动车的行驶路线和停放应服从统一指挥。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">（三）犀浦校区认真落实进校车辆停车入位制度。所有进入校园的车辆必须在规定的停车场或划有停车位的车位中有序顺向停放</span><span style=\"font-family: 宋体; font-size: 21px;\">。</span><span style=\"font-family: 宋体; font-size: 19px;\">切实推行校园商家车辆定点定位停车制度，须在指定专用停车位规范停放。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">（四）九里校区鉴于交通资源有限，入校车辆必须停放于有标志的停车区域内。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">（五）学校校车应在指定的场所停放和上下客。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">（六）实习车、大型客车、货车、工程车进入校园后，在规定区域停放。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">（七）校外因公来访车辆不得在校内过夜停放，确有需要者，须经保卫处同意，并在指定的停车场所或临时停放点停放车辆。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">（八）校园人行道、消防通道、绿化带、楼宇出入口、车辆与人员集散地通道以及无停车标志的道路和区域，严禁停放车辆。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">（九）九里校区百年校庆纪念碑周边、行政楼至镜湖宾馆沿湖内侧、大学生会堂旁、篮球场单边、一食堂主路单边、三教旁银杏小道禁止机动车停放。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">（十）犀浦校区西半环道路全线禁止停放机动车，所有车辆一律停至生态停车场内；工作日期间的特殊时段（上午11:30至13:00）内，在停车场停车位已满的情况下，允许机动车临时占道，停放在停车场一侧的环路上，占道停放的车辆需沿行驶方向顺向停放。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">其他时段在西环路一侧因取快递、接送人等缘由临时占道停车的，允许十分钟以内车辆开启双闪应急灯，停放于停车场一侧的环路上。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <strong><span style=\"font-family: 宋体; font-size: 19px;\">第二十三条</span></strong><span style=\"font-family: 宋体; font-size: 19px;\"> 对于校园内停放的逾期未办理车辆进出校园手续1个月以上，或因各种理由进出校园内临时停放超过1个月的车辆，由保卫处协同公安机关定时进行清理。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>&nbsp;&nbsp;</strong></span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 131px;\">\r\n    <strong><span style=\"font-family: 宋体; font-size: 19px;\">第六章&nbsp; 离校管理</span></strong> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <strong><span style=\"font-family: 宋体; font-size: 19px;\">第二十四条</span></strong><span style=\"font-family: 宋体; font-size: 19px;\"> 行人离开校园时按照本办法第十条相关规定执行，如携带物资应主动说明并配合门卫检查。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <strong><span style=\"font-family: 宋体; font-size: 19px;\">第二十五条</span></strong><span style=\"font-family: 宋体; font-size: 19px;\">&nbsp; </span><span style=\"font-family: 宋体; font-size: 19px;\">非机动车离开校园时按照本办法第十一条相关规定执行，如携带物资应主动说明并配合门卫检查。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <strong><span style=\"font-family: 宋体; font-size: 19px;\">第二十六条 </span></strong><span style=\"font-family: 宋体; font-size: 19px;\">&nbsp;因系统原因未能识别的校内车辆出示工作证件离开校园；系统外车辆按照门禁管理系统显示金额缴纳费用，并收取票据。严禁抢行、冲闸行为。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <strong><span style=\"font-family: 宋体; font-size: 19px;\">第二十七条</span></strong><span style=\"font-family: 宋体; font-size: 19px;\">&nbsp; </span><span style=\"font-family: 宋体; font-size: 19px;\">凡出入校园道路从事运输物品的车辆，需主动接受门卫检验，持相关单位出具证明，方可离开。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">&nbsp;</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-indent: 178px;\">\r\n    <strong><span style=\"font-family: 宋体; font-size: 19px;\">第七章 车辆预约管理</span></strong> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-indent: 46px;\">\r\n    <strong><span style=\"font-family: 宋体; font-size: 19px;\">第二十八条&nbsp; 因公来访车辆预约进校办理流程</span></strong> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-indent: 46px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">（一）校内各二级单位应指定一名工作人员专项负责校外车辆因公来访预约办理工作，预约申请原则上提前三个工作日报保卫处审核，原则上节假日期间不办理网上预约。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">（二）校内各二级单位在保卫处网站车辆预审系统申请因公来访车辆预约进校手续时，需实事求是地认真网上填写《车辆预约管理申报表》，按照表格内容填写因公来访详细信息（包括来访单位、来访事由、来访时间、车辆牌号、二级单位经办人联系方式等），事后一周内将本周发生的车辆预约信息，以纸质《车辆预约管理申报表》由二级单位相关负责人签字并加盖公章，提交保卫处备案。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">（三）保卫处在收到二级单位网上预约申请后，将车辆信息录入预约进校系统。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">（四）因公来访车辆在校访问期间，车辆凭号牌识别进出校园，如进校超过预约时间，将计时收费。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">（五）预约系统是方便二级单位与校外单位正常关系往来，非公务往来不得申请。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">（六）禁止各二级单位创收性的各类培训人员车辆的预约申请；禁止与学校交通管理文件政策不符的各类预约申请。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-indent: 37px;\">\r\n    <strong><span style=\"font-family: 宋体; font-size: 19px;\">第二十九条 </span></strong><span style=\"font-family: 宋体; font-size: 19px;\">各二级单位必须本着为学校负责任的态度认真执行校外车辆因公来访预约办理规定，严格管理，如发现违规申请或申请与信息不符的车辆进校情况，保卫处将立即取消该单位的预约申请权，同时由本单位对当事人进行处理。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-indent: 178px;\">\r\n    <strong><span style=\"font-family: 宋体; font-size: 19px;\">&nbsp;</span></strong> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-indent: 178px;\">\r\n    <strong><span style=\"font-family: 宋体; font-size: 19px;\">第八章 违规处理</span></strong> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-indent: 38px;\">\r\n    <strong><span style=\"font-family: 宋体; font-size: 19px;\">第三十条&nbsp; 行人及非机动车</span></strong> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-indent: 38px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">（一）行人及非机动车驾驶员如违反本规定的，保卫处交通管理人员一经发现将对其进行批评教育；</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-indent: 38px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">（二）不服从管理并态度恶劣者，属校内人员的将通报本单位，属校外人员的将被禁止再次入校；</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-indent: 38px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">（三）情况特别恶劣者，将交由公安机关依法处理。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <strong><span style=\"font-family: 宋体; font-size: 19px;\">第三十一条&nbsp; 机动车</span></strong> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">（一）对于违反本办法中机动车行驶及停放相关规定的，保卫处将对车辆采取贴违章告知单、锁车处理；情节严重的将采取拖车、移交交警处罚等处理。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-indent: 38px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">（二）在学校保卫处网站主页设置校园交通违章曝光台。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">机动车驾驶员属校内教职员工，违反学校车辆管理规定、不按校内行驶停放管理规定的，保卫处交通管理人员对其进行教育、批评、劝导；不服从管理的在违章曝光台进行曝光，通知其所在单位，并在学校范围内进行点名通报批评。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">1.</span><span style=\"font-family: 宋体; font-size: 19px;\">对首次违章的，曝光其车牌及车主姓名；</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">2.</span><span style=\"font-family: 宋体; font-size: 19px;\">第二次违章曝光车牌、车主姓名及所在单位；</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">3.</span><span style=\"font-family: 宋体; font-size: 19px;\">第三次违章的将其驾驶车辆车辆从管理系统中移出，取消当年度办理车辆出入校园手续，按照临时车辆计费进出校园。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">对态度恶劣拒不服从管理的，报公安交通管理部门按相关规定处理。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">（三）机动车驾驶员属校外人员的，违反本办法相关规定，情节轻微的，经批评教育后劝诫离校；经劝说无效或情节较重的，报公安交通管理部门按相关法规处理，同时在校园车辆管理系统内注销其进校资格，纳入系统黑名单，禁止进入校园。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">（四）实行车辆门禁系统禁止入校的黑名单制。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">校园内按学校规定办理了车辆进出校园手续并纳入系统管理的车辆，对使用假行驶证等虚假证件申请办理车辆出入校园、三次违章备案车辆，在车辆管理系统内注销其进校资格，按照临时入校车辆收费进出。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">继续违规的，纳入系统黑名单，禁止进入校园，同时次年取消办理进校资格。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">（五）购买（租赁）了九里校区南北园电梯公寓地下停车位的车辆，必须停放在地下停车场对应车位，严禁停放于九里校区校园道路路面上。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">对违反管理规定的车辆，按照以上规定处理。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">&nbsp;</span><strong><span style=\"font-family: 宋体; font-size: 19px;\">第三十二条&nbsp; </span></strong><span style=\"font-family: 宋体; font-size: 19px;\">违反本办法受到处罚车辆采取堵门等影响学校教学、科研秩序，影响学校师生日常生活的，保卫处根据相关工作预案处置，同时按照2015年11月1日颁布实施的刑法修正案第九条规定报公安机关处理。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: center; text-indent: 37px;\">\r\n    <strong><span style=\"font-family: 宋体; font-size: 19px;\">&nbsp;</span></strong> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: center; text-indent: 37px;\">\r\n    <strong><span style=\"font-family: 宋体; font-size: 19px;\">第九章&nbsp;交通事故处置</span></strong> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <strong><span style=\"font-family: 宋体; font-size: 19px;\">第三十三条 </span></strong><span style=\"font-family: 宋体; font-size: 19px;\">在校园内发生交通事故，应保护好现场，并及时拨打报警电话报告公安交通管理部门和学校保卫处。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <strong><span style=\"font-family: 宋体; font-size: 19px;\">第三十四条 </span></strong><span style=\"font-family: 宋体; font-size: 19px;\">保卫处接到校内交通事故报警后，应立即派人赶赴现场，协助抢救伤员，维持现场秩序，指挥疏导交通，并协助公安交通管理部门调解和处置交通事故。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <strong><span style=\"font-family: 宋体; font-size: 19px;\">第三十五条</span></strong><span style=\"font-family: 宋体; font-size: 19px;\"> 在校内发生的交通事故，需保卫处出具相关证明的，必须在事故发生时已向保卫处报告，事后保卫处将不予受理。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <strong><span style=\"font-family: 宋体; font-size: 19px;\">第三十六条 </span></strong><span style=\"font-family: 宋体; font-size: 19px;\">凡是符合简易处理的交通事故类型，当事人应尽快将车辆撤离交通事故现场，不得阻碍交通。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <strong><span style=\"font-family: 宋体; font-size: 19px;\">第三十七条 </span></strong><span style=\"font-family: 宋体; font-size: 19px;\">在校园内发生道路交通事故，造成道路、供电、供水、通讯等设施设备以及花草树木毁损的，事故责任人应当赔偿损失。造成人员伤亡的，由公安交通管理部门按照法律法规的相关规定进行处理。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">&nbsp;</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: center; text-indent: 37px;\">\r\n    <strong><span style=\"font-family: 宋体; font-size: 19px;\">第十章 附则</span></strong> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <strong><span style=\"font-family: 宋体; font-size: 19px;\">第三十八条</span></strong><span style=\"font-family: 宋体; font-size: 19px;\"> 本办法自公布之日起施行，由西南交通大学保卫处负责解释和执行。2013、2014年颁布的《西南交通大学关于加强成都两校区校园交通管理的通知》（西交校保卫[2013]3号）、《西南交通大学九里犀浦校区校外车辆入校的操作规范》、《关于转发西南交通大学&lt; 办理2014年机动车出入卡的公告&gt;的通知》、《西南交通大学关于进一步加强犀浦校区校园交通管理的通知》（西交校保卫[2014]2号）的文件规定同时废止。</span> \r\n</p>\r\n<p>\r\n    &nbsp;\r\n</p>\r\n<p style=\"text-align: left; text-indent: 37px;\">\r\n    <span style=\"font-family: 宋体; font-size: 19px;\">峨眉校区交通管理办法参照本办法另行制定执行。</span> \r\n</p>\r\n<p></p>', '/web-resource/add-on/lud/images/pictures/small/05.jpg', '为进一步加强校园交通管理，保障校园交通安全有序，维护学校正常的教学、科研和生活秩序以及师生员工的人身财产安全，根据《中华人民共和国道路交通安全法》《中华人民共和国道路交通安全法实施条例》及有关法律法规，结合学校实际，制定本办法。 ', '11', '2019-10-29 00:40:37', 1, '管理员', '保卫处', '1');
