INSERT INTO `lud_website_info` VALUES (1, 100201, 'web', '西南交通大学远程与继续教育学院', '西南交通大学远程与继续教育学院', '西南交通大学,远程与继续教育学院', '西南交通大学远程与继续教育学院是2013年7月由原成人（继续）教育学院、网络教育学院合并组建而成，代表学校归口管理各类学历继续教育、非学历继续教育和社会化考试等工作，是学校优质教育资源服务于社会的重要窗口。学院与“全国铁路机车司机培训考试中心”实行两块牌子，一套班子的运行模式，负责统筹、协调和指导全路机车司机的培训、统考工作。 \r\n\r\n继续教育一直是西南交通大学办学体系中的重要组成部分。学校在学历继续教育方面具有悠久的历史，从1956年即开办成人高等教育。经数十年发展，先后举办过夜大学、函授、脱产、半脱产、自考助学等形式的成人高等学历教育。2001年学校获教育部批准，成为可以开展现代远程教育的试点高校。在非学历继续教育方面，学校曾先后获批成为国家经贸委工商管理培训基地、铁道部继续教育西南基地、四川省专业技术人员继续教育基地，是全国高校继续教育学会常务理事单位。学校还积极承担各类行业和社会考试工作，是全国计算机等级考试四川中心考点，全国公共英语等级考试四川指导中心和中国市场营销资格考试的授权考点，是教育部“全国高校网络教育考试委员会成都考区办公室”。 \r\n', 'default', 'COPYRIGHT©西南交通大学远程与继续教育学院', 'LM', '18084815085', 'admin#xnjd.cn', '蜀ICP备05026985号-2', '门户网', 'fab fa-jsfiddle', 'nec-webs.swjtu.osxor.com');
